d:      .zero 16384
T1:     .zero 16384
T2:     .zero 16384
alpha: 	.word 1
beta:   .word 1
N:      .word 64

.text
        la  s1, a
        la  s2, b
        la  s3, c
        la  s4, d
        la  s5, T1
        la  s6, T2
        lw  s7, alpha
        lw  s8, beta
        lw  s9, N

        # Preliminary part: ... #

        # for(i=0,...,...){
        addi t0, zero, 4 
        add t1, zero, zero
        
        add a0, zero, s2
        add a1, zero, s6
iloop:
        # for(j=0,...,...){ #Go column first
        add t2, zero, zero #t2 is zero
jloop:        
        lw t4, 0(a0) #Get value of b
        sw t4, 0(a1) #Save it to T2
        
        # for(...,...,j++)
        addi t2, t2, 1
        add a0,a0,t0 #go to next B column
        
        add t3,zero,s9
        mul t3,t3,t0 #go to next T2 row
        add a1,a1,t3
        
        # for(...,j<size,...)
        blt t2, s9, jloop
        
        #else make both go to beggining
        add a0, zero, s2
        add a1, zero, s6
        
        #B goes down in row
        addi t1,t1,1
        
        add t3,zero,s9
        mul t3,t3,t0 #go to right B row
        mul t3,t1,t3
        add a0,a0,t3
        
        #T2 goes down in column
        
        add t3,zero,t0
        mul t3,t3,t1
        add a1,a1,t3
        
        # for(...,j<size,...)
        blt t1, s9, iloop
        

        # First part: T1 = A*B #

        # Initialization of auxiliaries:
        addi t0, zero, 4 #
        mul a3, s9, t0   # a3 -> 4*N
        add a0, zero, s1 # a0 -> *A
        add a1, zero, s6 # a1 -> *T2 Now
        add t0, zero, a1 # t0 -> *auxB = B
        add a2, zero, s4 # a2 -> *T1 #Will now be D
        add a4, zero, s3 # Will follow C
        add a5, zero, zero #Will determine change
        addi s10, zero, 128
        addi s11, zero, 32

        # for(i=0,...,...){
        add t1, zero, zero
f1loop1:
        # for(j=0,...,...){
        add t2, zero, zero
f1loop2:
        # for(k=0,...,...){
        add t3, zero, zero
        # aux1 = 0
        add t4, zero, zero
f1loop3:
        # ... += A[i][k] * ...
        lw t5, 0(a0)
        # ... += ... * B[k][j]
        lw t6, 0(t0)
        # ... += A[i][k] * B[k][j]
        mul t5, t5, t6 
        # aux1 += A[i][k] * B[k][j]
        add t4, t4, t5
        # A++
        addi a0, a0, 4
        # auxB += N*4 (moves to the next row) #Next column
        addi t0, t0, 4
        # for(...,...,k++)
        addi t3, t3, 1 
        # for(...,k<N,...)
        blt t3, s9, f1loop3
        # }
        # T1[i][j] = aux1; #GO TO D
        
        
        lw t0, 0(a4) #Get from C
        mul t0,t0,s8 #Mult by beta
        
        mul t4,t4,s7 #Mutiply by alpha right away
        add t4,t0,t4 #C[i,j]*beta + T1[i,j]*alpha
        
        sw t4, 0(a2)
        
        bnez a5, up
        
        # D++ C++
        add a2, a2, a3
        add a4, a4, a3
        
        # A -= N*4 (rewind to the first element of the row)
        #Do nothing, go to next row
        # B++ #next column
        # Let a1 stay, get t0 right
        # auxB = B
        add  t0, zero, a1
        addi a5, zero, 1
        
        bnez a5, notup
                  
up:        
        #A goes up
        # D++ C++
        sub a2, a2, a3
        sub a4, a4, a3
        addi a2, a2, 4
        addi a4, a4, 4
        
        sub a0, a0, a3
        sub a0, a0, a3
        
        add a1,a1,a3
        add t0, zero, a1
        
        addi a5, zero, 0
        
notup:
        # for(...,...,j++)
        addi t2, t2, 1
        # for(...,j<N,...)
        blt t2, s10, f1loop2
        # }
        
        # A += N*4 (moves to the next row)
        #Nothing, is already next row
        # B -= N*4 (rewind to the first element of the row) #of column
        add a1, zero, s6
        add a0,a0,a3
        add a0,a0,a3
        # auxB = B
        add t0, zero, a1
        add a2,a2,a3
        add a4,a4,a3
        
            
        # for(...,...,i++)
        addi t1, t1, 1
        # for(...,i<N,...)
        blt t1, s11, f1loop1
        # }

        # return
        li a7, 10
        ecall